import React from 'react';
import { Link } from 'react-scroll'; // react-scroll'dan Link import ediyoruz
import '../styles/Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">
        <h1>CRM Support Sistemi</h1>
      </div>
      <ul className="nav-links">
        <li><Link to="main" smooth={true} duration={500}>Ana Sayfa</Link></li>
        <li><Link to="about" smooth={true} duration={500}>Hakkımızda</Link></li>
        <li><Link to="contact" smooth={true} duration={500}>İletişim</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
